import React, { Component } from 'react';
import Header from './Header';
import Form from './Form';
import Roles from './Roles';
import Associated from './Associated';
import RoleData from './user_roles.json'
import './../App.css';

class App extends Component {

  state = {
    items: []
  } 
  componentDidMount() {
      this.setState({
        items: RoleData
      }); 
      console.log(RoleData);
  }

  render() {

     return (
        <div>
          <Header />
          <Form />
          {this.state.items.map( (item, index) => {
              return (
                <Roles 
                  key={index}
                  name={item.name}
                  type={item.type}
                  description={item.description}
                  postdate={item.modified_on}
                />
              ) 
            })
          }
          {item.users.map((users, i) => {
              return (
                <Associated 
                  key={i}
                  altID={users[index].first_name}
                  photo_url={users[index].photo_url}
                />
              )
            }
          )}
        </div>
      );
  }
}

export default App;
